import React from 'react';
import './face.css'; // Create a CSS file for styling

function Face() {
  return (
    <div className="face">
      <div className="eye left-eye">
        <div className="pupil"></div>
      </div>
      <div className="eye right-eye">
        <div className="pupil"></div>
      </div>
      <div className="nose"></div>
      <div className="mouth"></div>
    </div>
  );
}

export default Face;
